import { useFetch } from "Hooks/useFetch";
import { useEffect } from "react";

const App = () => {
  const { data: movies } = useFetch(
    "https://api.themoviedb.org/3/trending/movie/week?api_key=9483b1dc2a9ab631567764498b358b6c"
  );

  useEffect(() => {
    console.log(movies);
  }, [movies]);

  return (
    <>
      {movies.results.map((movie) => {
        return <pre key={movie.id}>{JSON.stringify(movie.title)}</pre>;
      })}
    </>
  );
};

export default App;
